lyrics:
//Somos de él//

Podemos decir que somos de él.



//Si es que vivimos o es que morimos

Podemos decir que somos de él//.



//Un grito de victoria se va a oír//

¿Dónde está sepulcro tu victoria?

¿Dónde está, oh muerte, tu aguijón?

